#include <iostream>
#include <vector>

using namespace std;
class Solution {
    //using this array to find the direction
    vector<vector<int>> position = {{1,0},{0,1},{-1,0},{0,-1}};
    //using two variables to define the border
    int m = 0;
    int n = 0;
    vector<vector<bool>> toSolve;
    vector<vector<bool>> visit;
    bool doNotCover;
public:
    void solve(vector<vector<char>>& board) {
        m = board.size();
        if(m==0){
            return;
        }
        n = board[0].size();
        doNotCover = false;
        vector<vector<bool>> visit1(m,vector<bool>(n,false));
        visit = visit1;
        vector<vector<bool>> toSolve2(m,vector<bool>(n,false));
        toSolve = toSolve2;
        for(int i = 0;i<m;i++){
            for(int j = 0;j<n;j++){
                if(!visit[i][j] && board[i][j]=='O'){
                    if(i==0 || j ==0 || i==m-1 || j==n-1) doNotCover=true;
                    toSolve[i][j]=true;

                    _iter(board,i,j);

                    solveIter(doNotCover,board);
                    doNotCover=false;
                }
            }
        }
    }
    void solveIter(bool doNotCover,vector<vector<char>>& board){

        for(int i = 0;i<m;i++){
            for(int j = 0;j<n;j++){
                if(toSolve[i][j]){
                    if(doNotCover){
                        visit[i][j]=true;
                    }else{
                        board[i][j]='X';
                    }
                    toSolve[i][j]=false;
                }
            }
        }


    }
    void _iter(vector<vector<char>>& grid,int startX,int startY){
        find(grid,startX,startY,0,1);
        find(grid,startX,startY,0,-1);
        find(grid,startX,startY,1,0);
        find(grid,startX,startY,-1,0);

    }
    void find(vector<vector<char>>& grid,int startX,int startY,int ox,int oy){
        int x = startX+ox;
        int y = startY+oy;
        cout<<"x:"<<x<<" "<<y<<endl;
        if(x>=0 && x<m && y>=0 && y<n && !visit[x][y] && !toSolve[x][y] && grid[x][y] == 'O'){
            cout<<"in"<<endl;

            if(x==0 || y ==0 || x==m-1 || y==n-1) doNotCover= true;

            toSolve[x][y]=true;
            cout<<"in1"<<endl;
            if(x==75 && y==117){
                cout<<endl;
            }
            _iter(grid,x,y);
            cout<<endl;

        }else{
            cout<<"not in"<<endl;
        }
    }
};
